    name: "Mang Theo Thành Thị Làm giàu", after: "", chapter: "Full"},
    {title: "Người Đọc Sách Đại Ngụy", before: "", name: "Người Đọc Sách Đại Ngụy", after: "", chapter: "Chương 3565"},
    {title: "Bất Phụ Vinh Quang, Bất Phụ Em", before: "", name: "Bất Phụ Vinh Quang, Bất Phụ Em", after: "", chapter: "Chương 553"},
    {title: "[Thập Niên 60] Gây Dựng Lại Gia Đình", before: "[Thập Niên 60] ", name: "Gây Dựng Lại Gia Đình", after: "", 
    chapter: "Chương 163"},
    {title: "[Thập Niên 70] Kiều Tức Phụ", before: "[Thập Niên 70] ", name: "Kiều Tức Phụ", after: "", chapter: "Chương 246"}];

for (let i = 0; i < SelectedTranslationNovels.length; i++)
{
    SelectedTranslationNovels[i].image = images.translatedNovels[i];
}



const FullNovels = [{title: "Kẻ Thủ Hộ Vũ Trụ", before: "", name: "Kẻ Thủ Hộ Vũ Trụ", after: "", chapter: "Full"},
    {title: "[Bjyx] Minh Hôn Ám Luyến", before: "[Bjyx] ", name: "Minh Hôn Ám Luyến", after: "", chapter: "Full"},
    {title: "Hiên Gia Tọa Quốc", before: "", name: "Hiên Gia Tọa Quốc", after: "", chapter: "Full"},
    {title: "Sao Ngụ Nam Thành", before: "", name: "Sao Ngụ Nam Thành", after: "", chapter: "Full"},
    {title: "Boss Hệ Mộc Chỉ Muốn Làm Cá Mặn Vườn Trường", before: "", name: "Boss Hệ Mộc Chỉ Muốn Làm Cá Mặn Vườn Trường", after: "", 
    chapter: "Full"},
    {title: "Từ Khi Có Con Của Đối Thủ Một Mất Một Còn", before: "", name: "Từ Khi Có Con Của Đối Thủ Một Mất Một Còn", after: "", 
    chapter: "Full"},
    {title: "Cậu Thiếu Niên Tai Mèo Của Cô", before: "", name: "Cậu Thiếu Niên Tai Mèo Của Cô", after: "", chapter: "Full"},
    {title: "Tránh xa Tôi Ra Một Chút!", before: "", name: "Tránh xa Tôi Ra Một Chút!", after: "", chapter: "Full"},
    {title: "Cảm Nắng?!", before: "", name: "Cảm Nắng?!", after: "", chapter: "Full"},
    {title: "Hương Vị Ngọt Ngào Của Thanh Xuân", before: "", name: "Hương Vị Ngọt Ngào Của Thanh Xuân", after: "", chapter: "Full"},
    {title: "Sủng Tình: Sự Giam Cầm Cả Đời", before: "", name: "Sủng Tình: Sự Giam Cầm Cả Đời", after: "", chapter: "Full"},
    {title: "Dã Thú Dưới Váy Em", before: "", name: "Dã Thú Dưới Váy Em", after: "", chapter: "Full"}];

for (let i = 0; i < FullNovels.length; i++)
{
    FullNovels[i].image = images.fullNovels[i];
}

const dataDefault = {SelectedTranslationNovels: SelectedTranslationNovels, FullNovels: FullNovels};

export default dataDefault;
